var $bm_rt;
var freq = effect('BRAZU Wiggle (Rotation)')(1);
var ampBase = effect('BRAZU Wiggle (Rotation)')(2);
var loop = $bm_sub(1, effect('BRAZU Wiggle (Rotation)')(3));
var loopTime = $bm_div(1, freq);
var ampIn = easeOut($bm_sub(time, inPoint), 0, loopTime, $bm_mul(loop, ampBase), ampBase);
var ampOut = easeIn(time, $bm_sub(outPoint, loopTime), outPoint, ampBase, $bm_mul(loop, ampBase));
var amp = time < loopTime ? ampIn : ampOut;
$bm_rt = wiggle(freq, amp);
